import React from 'react';
import '../../App.css'
import tom from '../tom.jpg'
import { Button } from "@material-ui/core";
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import ListItemText from '@material-ui/core/ListItemText';
import Avatar from '@material-ui/core/Avatar';
import BeachAccessIcon from '@material-ui/icons/BeachAccess';
import Divider from '@material-ui/core/Divider';
import Typography from '@material-ui/core/Typography';
import { blue, green } from '@material-ui/core/colors';

const useStyles = makeStyles((theme) => ({
    root: {
        width: '100%',
        maxWidth: 600,
        marginLeft:100,
        marginTop:20,
        borderRadius:20,
        height:500,
        backgroundColor: theme.palette.background.paper,
    },

    informatin:{
        border: '10px',
        borderColor:'black',
        borderRadius:30,
        backgroundColor:'#ABEBC6',
        fontWeight:"bold",
        width:'90%',
        marginLeft:'10px'
    }


}));
export default function Profile() {
    const classes = useStyles();
    return (
        <div className='Profile-box'> 

            <div >
                <img className='Portrai' src={tom} alt='tom'/>
                <Button variant="contained" color="primary">change photh</Button>
            </div>
          
            <List className={classes.root}>
                <ListItem className={classes.informatin}>
                    <ListItemText primary="UserName" secondary="Tom" />
                </ListItem>
           
 
                <ListItem>
                    <ListItemText primary="email" secondary="123456@qut.edu.au" />
                </ListItem>
   
                <ListItem>
                    <ListItemText primary="First Language" secondary="English" />
                </ListItem>


                    <ListItem>
                        <ListItemAvatar>
                            <Avatar>
                                <BeachAccessIcon />
                            </Avatar>
                        </ListItemAvatar>
                        <ListItemText primary="Vacation" secondary="July 20, 2014" />
                    </ListItem>
            </List>

            </div>

       
    )
}
